import React, { Component } from 'react';
import { Text, View, Image, StyleSheet } from 'react-native';

export default class App extends Component {
  render() {
    return (
      <View>
        <View style={styles.background}>
          <Text style={styles.header}>FENDER YNGWIE MALMSTEEN STRATOCASTER</Text>
        </View>
        <View>
          <Text style={styles.segundoTitulo}>
            Harry Potter e o Enigma do Príncipe
          </Text>
          <Text style={styles.subTitulo}>Sexto ano de Harry em Hogwarts</Text>
        </View>
        <View style={styles.texto}>
          <Text>
            No sexto ano de Harry em Hogwarts, Lord Voldemort e seus Comensais
            da Morte estão criando o terror nos mundos bruxo e trouxa.
            Dumbledore convence seu velho amigo Horácio Slughorn para retornar a
            Hogwarts como professor de poções após Harry encontrar um estranho
            livro escolar. Draco Malfoy se esforça para realizar uma ação
            destinada por Voldemort, enquanto Dumbledore e Harry secretamente
            trabalham juntos a fim de descobrir o método para destruir o Lorde
            das Trevas uma vez por todas.
          </Text>
        </View>

        <View>
          <Image
            source={{
              uri:
                'https://lh3.googleusercontent.com/proxy/pZsmLip86oU9iHbimEu7nJFLG5-U-6rqTH2zf4GrBMnD1T9oZJwebxiieOAb9f9TYzatb7bFwojTX4lZETr9LK7axBsQkgSC9Xg2VvweZFiNG-8RsvUU',
            }}
            style={styles.image}
          />
        </View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  header: {
    fontSize: 20,
    fontWeight: 'bold',
    marginTop: 3,
    marginBottom: 10,
    textAlign: 'center',
    color: 'black',
  },
  background: {
    backgroundColor: '#063C75',
    flex: 1.5,
  },
  image: { width: 360, height: 250 },
  segundoTitulo: {
    fontSize: 15,
    fontWeight: 'bold',
    marginTop: 5,
    marginBottom: 1,
    textAlign: 'left',
    color: 'black',
    padding: 6,
  },
  subTitulo: {
    fontSize: 11,
    fontWeight: 'bold',

    textAlign: 'left',
    color: 'black',
    padding: 6,
  },
  texto: {
    fontSize: 10,
    marginTop: 2,
    padding: 12,
    marginBottom: 10,
    textAlign: 'justify',
    color: 'grey',
  },
});
